window.bookSummaryJSON = "<p>Alice begins her fantastic journey by following an unprecedented White Rabbit with a pocket watch. While in the topsy turvy world of Wonderland, Alice takes advice from a caterpillar and attends a mad tea party. She meets the Mock Turtle and the Gryphon, and participates in a ludicrous courtroom scene. Each character has its own charming voice, as B. J. Harrison delivers one of his most whimsical performances.</p>"; 
